	  String sex  ="";               
	  String birth  ="";             
	  String tel  ="";               
	  String hp   ="";               
	  String email  ="";             
	  String reg_date   ="";
	  
	  public MemberDTO() {
		// TODO Auto-generated constructor stub
	}

	public String getUser_id() {
		return user_id;
	}

	public void setUser_id(String user_id) {
		this.user_id = user_id;
	}

	public String getPwd() {
		return pwd;
	}

	public void setPwd(String pwd) {
		this.pwd = pwd;
	}

